        <?=$zakrep_arr?>
        $.each(zakr_arr,function(index,value){
            $('#'+index).addClass('zakrep');
            $('#'+index+' path').css('fill', '#'+value);
        });

        var seats = {};
        var comment = '';

        $( "g g g g" ).click(function() {
          if($(this).hasClass('active')){
            $(this).removeClass('active');
          }
          else{
            if(!$(this).hasClass('zakrep')){
                $(this).addClass('active');
            }
          }
        });

        $( "#zakrep" ).click(function() {
            $('g g g g.active').each(function(i, obj) {
                $(obj).addClass('zakrep');
                seats[i] = {};
                seats[i]['seatid'] = $(obj).attr('id');
                seats[i]['title'] = $(obj).attr('title');
            });
            comment = $('#zakreptext').val();
            $.post('?r=site/saver', {seats: seats, comment: comment}, function(data){});
        });


        var id = '';
        var commenttext = '';
        $('g g g g.zakrep').hover(
          function() {
            id = $(this).attr('id')+'comment';
            $('#'+id).removeClass('dispnone');
          }, function() {
            $('#'+id).addClass('dispnone');
          }
        );

        $('g g g g.zakrep').mousemove(function( event ) {
                id = $(this).attr('id')+'comment';
                x = event.offsetX + 100;
                y = event.offsetY - 220;
                $('#'+id).css('top', y);
                $('#'+id).css('left', x);
                $('#'+id).css('z-index', 600);
        });

        

        function zakrepTextInput(){
            if($('#zakreptext').val().length>0){
                $('#zakrep').removeClass('disabled');
                $('#zakrep').prop("disabled", false);
            }
            else{
                $('#zakrep').addClass('disabled');
                $('#zakrep').prop("disabled", true);
            }
        }
        function toHexString(n) {
            if(n < 0) {
                n = 0xFFFFFFFF + n + 1;
            }
            return "0x" + ("00000000" + n.toString(16).toUpperCase()).substr(-8);
        }
                
    </script>
